//////////////////////////////////////////WORKING TRY///////////////////////////////////////////
import React from "react";

// We use Route in order to define the different routes of our application
import {BrowserRouter as Router, Route, Switch } from "react-router-dom";

// We import all the components we need in our app
import Create from "./components/create";
import Login from "./components/login";
import WelcomeManager from "./components/WelcomeManager";
import Nav from "./components/nav";
import SimpleMap from "./components/SimpleMap";
import PieChart from "./PieChart";
import About from "./components/About";
import AddPackages from "./components/AddPackages";
import GroupPackages from "./components/GroupPackages";
import PacksToDistribute from "./components/PacksToDistribute";
import WelcomeDistributor from "./components/WelcomeDistributor";
const App = () => {
  return (

<Router>
    <div>

      <Nav/>
     <Switch>
     {/* <Route path="/" exact component={Home}/> */}

    <Route exact path="/register" exact component={Create}/>
    <Route exact path="/login" component={Login}/>
    <Route exact path="/WelcomeManager" component={WelcomeManager}/>
    <Route exact path="/WelcomeDistributor" component={WelcomeDistributor}/>
    <Route exact path="/PieChart" component={PieChart}/>

    <Route exact path="/SimpleMap" component={SimpleMap}/>
    <Route
                  exact
                  from="/about"
                  render={(props) => <About {...props} />}
                />
    <Route exact path="/AddPackages" component={AddPackages}/>
    <Route exact path="/GroupPackages" component={GroupPackages}/>
    <Route exact path="/PacksToDistribute" component={PacksToDistribute}/>
    </Switch>
    </div>

    <center><img class="center" src={require('./images/hands.jpg').default} height={700} width={700} /></center>

</Router>


  );
};

export default App;
